      <DataTable setSelected={setSelected} accvalues={accvalues} />
      <div className="pt-4">
        {/* Line chart */}
        <div
          className={`place-content-center rounded-xl p-5 shadow-md flex flex-wrap flex-2 flex-col gap-5 w-full max-w-2xl max-h-96 bg-${theme}`}
        >
          <LineChart title_text={"Recents"} data={lineChartData} />
